import React from "react";
import "./App.css";
// import DateTime from "./DateTime";
// // import WeatherApp from "./weather";

import { useState, useEffect } from "react";
import produce from "immer";

const Notes = (props) => props.data.map((note) => <div>{note.text}</div>);

export default () => {
  const initialData = [{ text: "Loading Notes ... " }];
  const [data, setData] = useState(initialData);

  const handleClick = () => {
    const text = document.querySelector("#noteinput").value.trim();
    if (text) {
      const nextState = produce(data, (draftState) => {
        draftState.push({ text });
      });
      document.querySelector("#noteinput").value = "";

      if (typeof window !== "undefined") {
        localStorage.setItem("data", JSON.stringify(nextState));
      }

      setData(nextState);
    }
  };

  useEffect(() => {
    if (typeof window !== "undefined") {
      const getData = localStorage.getItem("data");

      if (getData !== "" && getData !== null) {
        return setData(JSON.parse(getData));
      }
      return setData([]);
    }
  }, 0);

  return (
    <>
      <img
        className="bg_image"
        style={{
          width: 916,
          height: 578,
          left: 0,
          top: 0,
          position: "absolute",
          borderRadius: 20,
          border: "1px black solid",
        }}
        src="https://img.rawpixel.com/s3fs-private/rawpixel_images/website_content/rm428-0019-x.jpg?w=800&dpr=1&fit=default&crop=default&q=65&vib=3&con=3&usm=15&bg=F4F4F3&ixlib=js-2.2.1&s=16c4ed18afc4ccfb86f468a829d23a1d"
        alt="Loading..."
      />
      <>
        <input
          id="noteinput"
          style={{
            width: "50%",
          }}
          type="text"
          placeholder="Enter a new note"
        />
        <button onClick={() => handleClick()}>Add note</button>
        <Notes data={data} />
      </>
    </>
  );
};

